const Footer = () => {
  const currentYear = new Date().getFullYear();

  return (
    <footer
      style={{
        textAlign: "center",
        padding: "30px", // ðŸ”¥ Reduced padding (was 20px)
        marginTop: "200px", // Slightly smaller margin
        backgroundColor: "#f1f1f1",
        fontStyle: "normal",
        fontSize: "0.8rem", // ðŸ”¥ Make text slightly smaller (optional)
      }}
    >
      <p style={{ margin: 0 }}>&#169; {currentYear} Ahsanul Mostakin.</p>
    </footer>
  );
};

export default Footer;
